IF OBJECT_ID('week_day','V') IS NOT NULL
DROP VIEW week_day
GO

-- Tutaj je¿eli jedna osoba zalogowa³a siê w poniedzia³ek a wylogowa³a siê we wtorek
-- liczymy jej wizytê do obu tych dni powiedzmy, ¿e system wyrzuca u¿ytkownika 
-- po 24-godzinnej sesji i ka¿e siê ponownie zalogowaæ
CREATE VIEW week_day AS
SELECT day_name = names.day_name, unique_visits = COUNT(names.day_name)
FROM (
	SELECT day_name = DATENAME(WEEKDAY, date_enter)
	FROM visits
	UNION ALL
	SELECT DATENAME(WEEKDAY, date_exit)
	FROM visits
	WHERE CONVERT(DATE, date_enter) != CONVERT(DATE, date_exit)
) names
GROUP BY names.day_name
GO

IF OBJECT_ID('best_selling_items','V') IS NOT NULL
DROP VIEW best_selling_items
GO


CREATE VIEW best_selling_items AS (
SELECT
	product_name,
	sales = SUM(quantity_bought)
FROM sales
GROUP BY product_name
)
GO


-- ---------------------------------
-- Tworzenie procedur
-- ---------------------------------
IF OBJECT_ID('frequent_visits','P') IS NOT NULL
DROP PROCEDURE frequent_visits
GO

-- parameters: time interval
CREATE PROCEDURE frequent_visits ( 
	@begin DATE,
	@end DATE = NULL
) AS
-- Domyœlnie end to obecna data
	IF @end IS NULL SET @end = GETDATE()

	SELECT
		[user]   = user_name,
		[visits] = COUNT(*)
	FROM visits
	WHERE @begin < date_enter AND date_exit < @end
	GROUP BY user_name
	ORDER BY COUNT(*) DESC

	RETURN
GO

IF OBJECT_ID('buy_orders','P') IS NOT NULL
DROP PROCEDURE buy_orders
GO

CREATE PROCEDURE buy_orders (
	@id_visit INT
) AS
	SELECT
 		[items bought] = SUM(s.quantity_bought),
 		[moeny spent]  = SUM(p.price * s.quantity_bought)
	FROM visits v
	INNER JOIN sales s ON v.id_visit = s.id_visit
	INNER JOIN products p ON p.product_name = s.product_name
	WHERE v.id_visit = @id_visit
	RETURN
GO

IF OBJECT_ID('regression_metrics','P') IS NOT NULL
DROP PROCEDURE regression_metrics
GO

CREATE PROCEDURE regression_metrics (
	@algorithm VARCHAR(8)
) AS
BEGIN
	SELECT
		bias                           = AVG(DATEDIFF(SS, CAST(p.predicted_time AS DATETIME), (v.date_exit-v.date_enter)) * 1.0),
		[mean squared error]           = AVG(POWER(1.0 * DATEDIFF(SS, CAST(p.predicted_time AS DATETIME), (v.date_exit-v.date_enter)), 2)),
		[root mean squared error]      = SQRT(AVG(POWER(1.0 * DATEDIFF(SS, CAST(p.predicted_time AS DATETIME), (v.date_exit-v.date_enter)), 2))),
		[mean absolute error]          = AVG(ABS(DATEDIFF(SS, CAST(p.predicted_time AS DATETIME), (v.date_exit-v.date_enter))) * 1.0),
		[confidence interval coverage] = AVG(
		CASE 
			WHEN CAST(v.date_exit - v.date_enter AS TIME) BETWEEN p.low_pred AND p.high_pred THEN 1.0
			ELSE 0.0
		END
	)
	FROM predictions p
	INNER JOIN visits v ON p.id_visit = v.id_visit
	WHERE p.alg_name = @algorithm
	RETURN
END
GO

